import logo from './logo.svg';
import './App.css';
import slive_1 from './assets/images/1988s_slive_1.jpg'
import slive_2 from './assets/images/1988s_slive_2.jpg'
import FlipCoin from './components/FlipCoin.js'


function App() {
  return (
    <div className="App">
      <div>
        <h1>Let's flip a coin!</h1>
        <FlipCoin></FlipCoin>
        <button>FLIP MEEEE!</button>
        <p>Out of 0 flips, there have been 1 heads and 0 tails</p>
      </div>
    </div>
  );
}

export default App;
